import React from "react"
import Seat from './Seat'

const SeatAvailability = () => {
	return (
		<div className="row2">
			Vazio : <Seat seatColor="seat-grey" /> Ocupado : <Seat seatColor="seat-red" /> Selecionado : <Seat seatColor="seat-black" />
		</div>
	)
}

export default SeatAvailability
